import React from "react";

const ScrollableComponent = ({ children, styles }) => {
  const newStyle = {
    maxHeight: "80vh",
    overflowY: "scroll",
    ...styles,
  };
  return <div style={newStyle}>{children}</div>;
};

export default ScrollableComponent;
